// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract ElectX {
    struct Candidate {
        bytes32 id;
        string name;
        string party;
        uint256 votes;
    }

    mapping(bytes32 => Candidate) candidatesMap;
    mapping(address => bytes32) votesMap;
    uint256 pollStart;
    uint256 pollEnd;
    bytes32[] candidatesID;
    string description;

    modifier isValidCandidate(bytes32 _id) {
        require(candidatesMap[_id].id != 0, "Candidate does not exist");
        _;
    }

    modifier isWithinPollDate() {
        uint256 currentTime = block.timestamp;
        require(
            pollStart < currentTime,
            "The polls are not yet open for this election"
        );
        require(
            currentTime > pollEnd,
            "The polls have closed for this election"
        );
        _;
    }

    constructor(
        string[2][] memory _candidates,
        string memory _description,
        uint256 start,
        uint256 end
    ) {
        // loop through all the candidates [ [ name, party ] ]
        for (uint256 i = 0; i < _candidates.length; i++) {
            // get current candidate
            string[2] memory thisCandidate = _candidates[i];
            string memory candidateName = thisCandidate[0];
            string memory candidateParty = thisCandidate[1];
            // create unique ID for given candidate
            bytes32 id = keccak256(bytes(candidateName));
            // map candidate ID to candidate Information
            candidatesMap[id] = Candidate({
                id: id,
                name: candidateName,
                party: candidateParty,
                votes: 0
            });
            // store candidates ID for easy iteration
            candidatesID.push(id);
        }

        // set poll start and end date
        pollStart = start;
        pollEnd = end;
        description = _description;
    }

    // fetch candidates
    function getCandidate(bytes32 _id)
        public
        view
        isValidCandidate(_id)
        returns (string memory name, uint256 votes)
    {
        Candidate memory currentCandidate = candidatesMap[_id];
        name = currentCandidate.name;
        votes = currentCandidate.votes;
    }

    // addVote
}
